import styled from 'styled-components'

const formDiv = styled.form `
width: 705px;
height: 425px;
left: 368px;
top: 392px;

background: #FFFFFF;
box-shadow: 4px 10px 4px rgba(0, 0, 0, 0.25);
border-radius: 50px;
`

const labelForm = styled.label `
    font-family: Roboto;
    font-style: normal;
    font-weight: normal;
    font-size: 24px;
    line-height: 28px;

    color: #000000;
`

export default function Home () {
    return (
        <div style={{ display: 'bloc', height: '100vh'}}>
            <div style={{ backgroundColor: '#0D79CA', height: '50vh'}}>
                
            </div>
            <div style={{ backgroundColor: '#EEF2F6', height: '50vh'}}>
            <formDiv>
                <label>Connexion</label>
                <div>
                    <label>Nom d'utilisateur</label>
                    <input type='text'/>
                </div>
            </formDiv>
                
            </div>
        </div>
    );
}
